  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:04.839670\",\n\t\"name\": \"fort-peck-game-range-narrative-report-may-august-1958\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Peck NWR
  and the easement refuges outlines Refuge accomplishments from May through August
  of 1958. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, mammals, raptors, reptiles, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, and wildfires. Resource management is outlined; topics
  include haying. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, fishing, and violations. Items of interest,
  N-R forms, and photographs are attached.\",\n\t\"license_title\": \"License Not
